  null,\n\t\"notes\": \"Southern Biscayne Bay's shoreline fish community been monitored
  visually twice a year since 1998 to compare fish use of mangrove prop root habitats
  along the mainland with that along the leeward side of the northernmost Florida
  Keys.  This has been pursued by examining seasonal and spatial variation in fish
  taxonomic composition and diversity as well as variation in the frequency of occurrence,
  density and size structure of dominant fish taxa that occupy these mangrove?lined
  shorelines.  The purpose of this MAP activity is to ensure the continuation and
  spatial expansion of this 14-year baseline? time-series with an emphasis on evaluating
  relationships between the shoreline fish community and variation in salinity/freshwater
  flow\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
